class Solution:
    def findLHS(self, nums: list[int]) -> int:
        ans = 0
        nums.sort()
        min_indexes = dict()
        max_indexes = dict()
        prev = nums[0]
        min_indexes[prev] = nums.index(prev)
        for num in sorted(tuple(set(nums).difference([nums[0]]))):
            min_indexes[num] = nums.index(num)
            max_indexes[prev] = min_indexes[num] - 1
            prev = num
        max_indexes[nums[-1]] = len(nums) - 1
        for num in sorted(tuple(set(nums))):
            min_idx = min_indexes[num]
            max_idx = max_indexes.get(num + 1)
            if max_idx:
                ans = max(max_idx - min_idx + 1, ans)
        return ans

# Решение с LeetCode
class Solution:
    def findLHS(self, nums: list[int]) -> int:
        from collections import Counter

        freq = Counter(nums)
        ans = 0
        print(freq)

        for key in freq:
            if key + 1 in freq:
                ans = max(freq[key] + freq[key + 1], ans)
        return ans


